import React from "react";
import './project.css';
import Card from '../Card/Card';
export default function Projects(){

    const arr=["pr-1","pr-2","pr-3"];

    return(
        <>
        <div className="project" id="projects">
              <div className="project-container">
                      <div className="layer1">
                          <h1>Projects</h1>
                      </div>
                      <div className="layer2">
                          <div className="content1">Html|Css|Js</div>
                          <div className="content2">ReactJS</div>
                          <div className="content3">NodeJS|MDB</div>
                      </div>
                      <div className="layer3">
                          <div className="pr-1">
                              <div className="items">
                                   {/* <Card text={arr[0]}/>
                                   <Card text={arr[1]}/>
                                   <Card text={arr[2]}/> */}
                               </div>
                          </div>

                      </div>
              </div>
        </div>
        </>
    );
}
